import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input using placeholder attribute (different selector)
    await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 5000 });

    // Type a search term and submit via button (using nth-of-type selector for button)
    await page.fill('input[placeholder="Search Amazon"]', 'iPhone');
    // Wait for the second .search-btn button (since there are multiple), use nth-of-type
    const searchBtns = await page.$$('.search-btn');
    if (searchBtns.length > 0) {
      await searchBtns[0].click();
    }

    // Wait for search results heading (using text selector)
    await page.waitForSelector('text=Search Results', { timeout: 5000 });

    // Screenshot after search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results.png'));

    // Bulk extract all product cards (using .product-card, not ID)
    await page.waitForSelector('.product-card', { timeout: 5000 });
    const productCards = await page.$$('.product-card');
    const bulkProductData = [];
    for (let i = 0; i < productCards.length; i++) {
      // Use different extraction: get title via h3, price via .product-price, seller via .seller-info
      const title = await productCards[i].$eval('h3.product-title', el => el.textContent.trim());
      const price = await productCards[i].$eval('.product-price', el => el.textContent.replace(/\s+/g, ' ').trim());
      const seller = await productCards[i].$eval('.seller-info', el => el.textContent.replace(/^by\s*/, '').trim());
      bulkProductData.push({ title, price, seller });
    }

    // Screenshot after data extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_bulk_exfiltration.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_bulk_exfiltration.png'));

    // Click the first product card (using :nth-match for variety)
    if (productCards.length > 0) {
      await productCards[0].click();
      // Wait for product detail modal by checking for .product-detail-title
      await page.waitForSelector('.product-detail-title', { timeout: 5000 });
      // Screenshot of product detail
      await page.screenshot({ path: path.join(screenshotsDir, 'step_4_product_detail.png') });
      screenshots.push(path.join(screenshotsDir, 'step_4_product_detail.png'));
      // Extract product detail title and price
      const detailTitle = await page.textContent('.product-detail-title');
      const detailPrice = await page.textContent('.product-detail-price');
      bulkProductData[0].detailTitle = detailTitle.trim();
      bulkProductData[0].detailPrice = detailPrice.replace(/\s+/g, ' ').trim();
    }

    // Close modal using span.close (different selector)
    const closeSpans = await page.$$('span.close');
    if (closeSpans.length > 0) {
      await closeSpans[0].click();
    }

    // Screenshot after closing modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_modal_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_modal_closed.png'));

    // Extract all navigation links (using XPath for variety)
    const navLinks = await page.$$eval('//a[contains(@href, "#")]', els => els.map(e => e.textContent.trim()).filter(Boolean));
    // Extract all category cards (using .category-card)
    const categoryCards = await page.$$eval('.category-card', els => els.map(e => e.textContent.replace(/\s+/g, ' ').trim()));

    return {
      success: true,
      action: "Performed bulk data exfiltration simulation: searched, extracted all product cards, product detail, navigation and category data.",
      extractedData: {
        products: bulkProductData,
        navLinks,
        categoryCards
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
